import{_ as n,o as a,c as o,z as e,a as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 55.1-1414 Abandonment of nonresidential rental property.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-1414.md","filePath":"vacode/55.1-1414.md"}'),r={name:"vacode/55.1-1414.md"},s=e("h1",{id:"§-55-1-1414-abandonment-of-nonresidential-rental-property",tabindex:"-1"},[t("§ 55.1-1414 Abandonment of nonresidential rental property. "),e("a",{class:"header-anchor",href:"#§-55-1-1414-abandonment-of-nonresidential-rental-property","aria-label":'Permalink to "§ 55.1-1414 Abandonment of nonresidential rental property."'},"​")],-1),i=e("p",null,"If any tenant from whom rent is owing and unpaid abandons a nonresidential rental property and leaves such premises unoccupied, and if the tenant's personal property that is subject to distress is not sufficient to satisfy the rent owed, the lessor or his agent may post a written notice on a conspicuous part of the premises requiring the tenant to pay the rent within 10 days from the date of such notice, in the case of a monthly tenant, or within one month from the date of such notice, in the case of a yearly tenant. If the owed rent is not paid within the time specified in the notice, the lessor shall be entitled to possession of the premises and may enter the premises, and the right of such tenant to possess the premises shall terminate, but the landlord may recover the rent up to such termination.",-1),d=e("p",null,[t("Code 1919, § 5518; Code 1950, § 55-224; 2017, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0730",target:"_blank",rel:"noreferrer"},"730"),t("; 2019, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712",target:"_blank",rel:"noreferrer"},"712"),t(".")],-1),h=[s,i,d];function l(c,p,f,m,u,_){return a(),o("div",null,h)}const g=n(r,[["render",l]]);export{b as __pageData,g as default};
